const Test = () => {

  let initial = [
    {
        Appointment: 12345,
        charge: 26,
        date: '2022-07-12'
    },

    {
      Appointment: 12346,
      charge: 20,
      date: '2022-08-12'
    },

    {
      Appointment: 12347,
      charge: 30,
      date: '2022-06-05'
    },
    {
      Appointment: 12348,
      charge: 22,
      date: '2022-08-09'
    },
    {
      Appointment: 12349,
      charge: 34,
      date: '2022-08-11'
    }
];

const [payment,Setpaymnet] = useState(initial)



  return (
   <div className='container'>
    <select className="form-control" style={{width:"300px"}}>
      <option value="">Sort By</option>
      <option value="">Price low to hight</option>
      <option value="">Price high to low</option>
      <option value="">Date low to hight</option>
      <option value="">Date high to low</option>

    </select>
      <ul className="mt-5" style={{listStyle:"none"}}>
        {payment.map((value,key)=>{
          return(
            <li style={{padding:"15px",borderBottom:"1px solid lightgray"}}>Appointment: {value.Appointment}<br />
            Charge: &nbsp;&nbsp;&nbsp; ${value.charge}<br />
            {value.date}
            </li>
          )
        })}

      </ul>
   </div>
  )
}

export default Test
